import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import Auth from "./components/Auth";
import App from "./App";

const router = createBrowserRouter([
    {
      path: "/",
      element: <Main />,
      children: [
        {
          path: "main",
          element: <App />,
        },
        {
          path: "login",
          element: <Auth />,
        },
    ]}
]);

function Main() {
    return <RouterProvider router={router} />;
}

export default Main;
